import React, {Fragment} from 'react';
import Login from './login/Login';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import { Container } from 'semantic-ui-react';
import Menu from './components/Menu'
import Header from './components/pagHeader'



function App() {
  return (
    <Router>
      <Switch>
        <div className="App">
          <Route path="/login" exact component={Login}/>
          <Fragment>
            <Menu/>
            <Container>
              <Header/>
            </Container>
          </Fragment>
          {/*<Route path="/registro" exact component={El componente del deiby} />*/}
          {/*<Route path="/" exact component={El componente del deiby} />*/}
        </div>
      </Switch>
    </Router>
  );
}

export default App;
